import React from "react";
import "./search-style.css";

export const Search = ({ placeholder, handleChange }) => {
  return (
    <div className="search-bar">
      <input
        className="search"
        type="search"
        placeholder={placeholder}
        onChange={handleChange}
      ></input>
    </div>
  );
};
